    },
    {
        src: 'images/PXP-0982.jpg'
    },
    {
        src: 'images/PXP-0982.jpg'
    },
]

function Gallery() {
    
  return (
    <div>
        {
            imageArray.map((image, index) => {
                <div key={index}>
                    <img src={image[index].src} style={{width: '300px', height: '300px'}}/>
                </div>
            })
        }
    </div>
  )
}

export default Gallery
